class Form extends Component {

    render() {
        return (
            <div className="Form">
                <form>
                    <label>
                        Name:
                 <input type="text" />
                    </label>
                    <input type="submit" value="Submit" />
                </form>
            </div>
        );
    }
}
export default Form;
